import './App.css';
import { Navegador } from './navegador.js';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom'



function App() {
  return (
    <div>
      <Router>
        <Routes>
          <Route path='/' element={<Navegador></Navegador>}>
          </Route>
        </Routes>
      </Router>


    </div>
  );
}

export default App;
